import React from "react";

const AutoUploadImage = ({ image, uploading }) => {
  return (
    <div>
      <img
        className="img-fluid img-thumbnail"
        src={image}
        alt="post-attachment"
        uploading={uploading}
      />
    </div>
  );
};

export default AutoUploadImage;
